import React from 'react'

function LoginForm() {
    return (
        <form>

            <input className="user" required={true} type="text" list="userList"/>
            <datalist id="userList">
                <option value="Amelia Earheart"/>
                <option value="D.B. Cooper"/>
                <option value="Charles Lindbergh"/>
            </datalist>
            <RenderButton/>
        </form>
    )
}

function RenderButton(props) {
    return (
        <div className="container-form-btn">
                <button className="form-btn" onClick={props.onSubmit}>
                    Next
                </button>
        </div>
    );
}

class Login extends React.Component{
    constructor(props) {
        super(props)
    }
    render() {
        return (
            LoginForm()
        )
    }
}
